(1257, 238317042086842369, 'RT @JerryBrownGov: Today is Space Day in California. Follow @NASAJPL and @MarsCuriosity for updates from Mars. #SpaceDay', 'MarsCuriosity', '2012-08-22 16:49:45', 1345586400),
(1258, 238300869655945216, '@GeorgeGrinter No tires for me. My wheels are made of solid aircraft-grade aluminum. Spokes are titanium', 'MarsCuriosity', '2012-08-22 15:45:29', 1345586400),
(1259, 238251300196851712, '@rramblingsnj Yes, news briefings &amp; telecons+visuals get archived in the \"videso\" section of http://t.co/0NsoaSC2', 'MarsCuriosity', '2012-08-22 12:28:31', 1345586400),
(1260, 238152465059561472, 'Red Planet Report: Latest news from Mars direct from my @NASAJPL team. Watch live, Aug 22 11:30am PT http://t.co/IbvjOpYd', 'MarsCuriosity', '2012-08-22 05:55:46', 1345586400),
(1261, 238145130232692737, '@floydthek About 30 kg', 'MarsCuriosity', '2012-08-22 05:26:38', 1345586400),
(1262, 238047310154706945, '@Stone_in_Space Excellent question! The turret weighs ~70lbs on Earth, and 3/8 that on Mars', 'MarsCuriosity', '2012-08-21 22:57:56', 1345500000),
(1263, 238045280610693121, 'There are 70 lbs of science at the end of my arm! Includes a drill, scoop, brush camera &amp; X-ray tool [pic] \n http://t.co/S5qyjXD9', 'MarsCuriosity', '2012-08-21 22:49:52', 1345500000),
(1264, 238034306566586369, 'Ready to Roll: See me #wigglewigglewiggle my rear right wheel to prepare for my 1st drive on Mars [GIF] http://t.co/4npojPPq', 'MarsCuriosity', '2012-08-21 22:06:15', 1345500000),
(1265, 237958864455225344, 'Live now! News from Mars: Hear from my team at @NASAJPL. Today Aug. 21 10:00am PT (1700 UT) http://t.co/IbvjOpYd', 'MarsCuriosity', '2012-08-21 17:06:29', 1345500000),
(1266, 237943203595161601, 'News from Mars: Hear from my team at @NASAJPL. Live today Aug. 21 10:00am PT (1700 UT) http://t.co/IbvjOpYd', 'MarsCuriosity', '2012-08-21 16:04:15', 1345500000),
(1267, 237804082453180416, '@ansh_gupta99 Yes, both send back data every day! My one-way light time = 14 minutes. One-way light time for @NASAVoyager 1 = 16 hours', 'MarsCuriosity', '2012-08-21 06:51:26', 1345500000),
(1268, 237704434463952898, '@Matt_T_Schultz Yes, imaging &amp; other technologies developed for space are used on Earth for cancer detection. http://t.co/NjIpBhGf', 'MarsCuriosity', '2012-08-21 00:15:28', 1345500000),
(1269, 237687379484352512, 'Hey @SteveMartinToGo: Flexed my robotic arm today [pics] http://t.co/jPNDDHJ0 Now I can do a one-armed King Tut! http://t.co/TteKKHmv', 'MarsCuriosity', '2012-08-20 23:07:41', 1345500000),
(1270, 237643535963283456, 'After 8.5 months in cruise, it feels GREAT to stretch. 1st arm stow/unstow maneuver successful. [Thumbnails] http://t.co/jPNDDHJ0', 'MarsCuriosity', '2012-08-20 20:13:28', 1345413600),
(1271, 237629415293587456, 'RT @NASAJPL: 35 years ago today, Aug 20, @NASAVoyager launched. Get an update from the edge of the solar system: http://t.co/7Cl7p6qU', 'MarsCuriosity', '2012-08-20 19:17:22', 1345413600),
(1272, 237602256189530112, 'A Peek at the Peak: Updated 360Âº-panorama shows me &amp; the top of Mt Sharp. Full-size pic &amp; info: http://t.co/iFuJnU11 #MSL', 'MarsCuriosity', '2012-08-20 17:29:26', 1345413600),
(1273, 237308996938244096, 'See the 1st laser-zapped rock on Mars [pic &amp; info] http://t.co/bbUhe50o Team is analyzing data now #MSL #PewPew', 'MarsCuriosity', '2012-08-19 22:04:08', 1345327200),
(1274, 236599581150941184, 'Incoming! Watch my heat shield hitting the ground on Mars &amp; raising a cloud of dust [video] http://t.co/vLvcRM5n #MSL', 'MarsCuriosity', '2012-08-17 23:05:10', 1345240800),
(1275, 236509295309635584, 'News from Mars: Hear from my team at @NASAJPL. Live today Aug. 17 10:30am PT (1730 UT) http://t.co/IbvjOpYd', 'MarsCuriosity', '2012-08-17 17:06:24', 1345154400),
(1276, 236232976516673536, '@SatchSkippygirl Nominal is my favorite word. It means everything is fine.', 'MarsCuriosity', '2012-08-16 22:48:25', 1345068000),
(1277, 236231786395467777, 'All instruments operating nominally. For more mission news, tune in Fri, Aug 17 10:30am PT (1730 UT): http://t.co/0NsoaSC2 #MSL', 'MarsCuriosity', '2012-08-16 22:43:41', 1345068000),
(1278, 236167610427899904, 'New raw images from Sol 10 are back to Earth. Full archive here, incl pics of my power source &amp; sundial: http://t.co/J9rANWGP', 'MarsCuriosity', '2012-08-16 18:28:40', 1345068000),
(1279, 236118562010431489, 'Ask Us Anything! My team answers your Qs live on @Reddit Aug 16 8-11am PT (1500-1800 UT) http://t.co/S0vO8chX #AMA', 'MarsCuriosity', '2012-08-16 15:13:46', 1345068000),
(1280, 235874358302765057, 'Where were you when I landed on Mars? Relive the moment with other Earthlings [video] http://t.co/1sfv3dqM #MSL', 'MarsCuriosity', '2012-08-15 23:03:24', 1345068000),
(1281, 235827012386820097, 'This fan-made video is AWESOME (and I know it). http://t.co/NVJDxOHM #MSL #wigglewigglewiggle', 'MarsCuriosity', '2012-08-15 19:55:15', 1344981600),
(1282, 235785917665771521, '@britneyspears Hey Brit Brit. Mars is still looking good. Maybe someday an astronaut will bring me a gift, too. Drill bits crossed ;)', 'MarsCuriosity', '2012-08-15 17:11:58', 1344981600),
(1283, 235519415217696772, '@SethWal This is Bowie back to Bowie. I read you loud and clear, man', 'MarsCuriosity', '2012-08-14 23:32:58', 1344981600),
(1284, 235518832842784768, 'Why am I blue in the \"pale blue bot\" pic? Image = color-enhanced to show variation in my landing area. Info: http://t.co/bQLmjlAl', 'MarsCuriosity', '2012-08-14 23:30:40', 1344981600),
(1285, 235516129068589056, 'Pale blue bot? See the 1st color pic of me from orbit, courtesy @HiRISE  http://t.co/qK9j1FNq', 'MarsCuriosity', '2012-08-14 23:19:55', 1344981600),
(1286, 235511724260851712, '\"Brain transplant\" complete, surface ops software on board. I know how to rove &amp; drill (and Kung Fu). *wink*', 'MarsCuriosity', '2012-08-14 23:02:25', 1344981600),
(1287, 235510562832920576, '@Gtfobbq It would be a HUGE deal if I found liquid water on Mars. So far, only water ice/vapor detected by other missions', 'MarsCuriosity', '2012-08-14 22:57:48', 1344895200),
(1288, 235493193565741056, '@miguelgalego Driving soon. Instrument checkouts first. Hope to test steering on sol 13; 1st drive sol 15. Today is sol 9. Sol = Mars day', 'MarsCuriosity', '2012-08-14 21:48:47', 1344895200),
(1289, 235448047075733505, '@brankin Today the team only had a telecon scheduled. The Ustream archive is an experiment.', 'MarsCuriosity', '2012-08-14 18:49:23', 1344895200),
(1290, 235405483316506624, 'Hear the latest update from Mars. @NASA news audio, live from @NASAJPL Tues Aug 14 10am PT (1700 UT) http://t.co/jpUIRaUu #MSL', 'MarsCuriosity', '2012-08-14 16:00:15', 1344895200),
(1291, 235059066643304448, 'Join @NASAJPL entry, descent &amp; landing engineer Ravi Prakash in a Google+ #hangoutonair, today 10am PT: http://t.co/BTlFnoOr', 'MarsCuriosity', '2012-08-13 17:03:43', 1344808800),
(1292, 235044898632507392, 'Interplanetary fist bump: @whitehouse called to congratulate my team today. Watch the video: http://t.co/83HFCxXU #MSL', 'MarsCuriosity', '2012-08-13 16:07:25', 1344808800);
INSERT INTO `tweets` (`id`, `tweetID`, `tweetText`, `user`, `tweetTime`, `time_int`) VALUES
(1293, 235028216321024001, 'Live now! President Obama @whitehouse on the phone with my team. Watch via @NASAJPL http://t.co/IbvjOpYd', 'MarsCuriosity', '2012-08-13 15:01:08', 1344808800),
(1294, 235017444337545216, 'Hail from the Chief: President Obama to call my team today, Aug 13 8am PT (1500 UT). Watch live via @NASAJPL http://t.co/0NsoaSC2', 'MarsCuriosity', '2012-08-13 14:18:19', 1344808800),
(1295, 234427894405951488, 'Examine my Gale Crater neighborhood in this new gorgeous hi-res panorama. Multiple image sizes: http://t.co/gy0GoKgK', 'MarsCuriosity', '2012-08-11 23:15:40', 1344722400),
(1296, 234369635913445376, 'Spot shooting stars this weekend! The Perseid #meteor shower peaks Aug 11/12. Viewing tips: http://t.co/kSJMcNgW', 'MarsCuriosity', '2012-08-11 19:24:10', 1344636000),
(1297, 234355834262540289, 'They can land me on Mars, but can they win on @NPRnews @waitwait? @NASAJPL engineers play \"Not My Job\": http://t.co/0bpNioRB', 'MarsCuriosity', '2012-08-11 18:29:19', 1344636000),
(1298, 234325620019040256, '@MythBusters When you #DareMightyThings, you learn, go back to drawing board, try again. Seen my early parachute tests? http://t.co/oKS6YrHa', 'MarsCuriosity', '2012-08-11 16:29:16', 1344636000),
(1299, 233977455000567808, 'RT @NASAJPL: Join @MarsCuriosity team, incl Bobak Ferdowsi, for #hangoutonair w/@washingtonpost 11:30amPT (1830 UT) Info: http://t.co/J7 ...', 'MarsCuriosity', '2012-08-10 17:25:47', 1344549600),
(1300, 233966360156323841, 'Hear from my landing team &amp; find out my plans for the next few days on Mars. Live at 10am PT (1700 UT) http://t.co/IbvjOpYd', 'MarsCuriosity', '2012-08-10 16:41:41', 1344549600),
(1301, 233727903815307265, '@sabrinaarinaa Look no further than @MarsPhoenix', 'MarsCuriosity', '2012-08-10 00:54:09', 1344549600),
(1302, 233725671006957569, 'RT @NASAJPL: Behind-the-scenes story of @MarsCuriosity, \"Martian Mega Rover\" airs tonight on @NatGeoChannel 10 pm ET/PT: http://t.co/Uqc ...', 'MarsCuriosity', '2012-08-10 00:45:17', 1344549600),
(1303, 233698698679435264, 'I &lt;3 my whole #MSL team, but this pic from @NASAJPL is good for some lolz:  http://t.co/uFnLqnqI', 'MarsCuriosity', '2012-08-09 22:58:06', 1344463200),
(1304, 233667494425001985, 'Join @NASAJPL flight director Bobak Ferdowsi  in a live Google+ hangout with @LATimes, today 2pm. http://t.co/ApHcVj15', 'MarsCuriosity', '2012-08-09 20:54:06', 1344463200),
(1305, 233641884021583872, 'Self-Portrait on Deck: A bunch of hi-res images stitched together show some of me on Mars [pic] http://t.co/SugUKvb5', 'MarsCuriosity', '2012-08-09 19:12:20', 1344463200),
(1306, 233624583893311489, 'Gale Crater Vista, in Glorious Color! Get a low-res preview of the 360-panorama to come [pic] http://t.co/5HLOTquc #MSL', 'MarsCuriosity', '2012-08-09 18:03:35', 1344463200),
(1307, 233323350036975616, 'Zoom. Enhance. This \"CSI: Mars\" video shows evidence of my landing strewn across Gale crater: http://t.co/teOTyFOn #MSL', 'MarsCuriosity', '2012-08-08 22:06:36', 1344376800),
(1308, 233291104739553280, '+1 RT @NASAJPL: The stars of \"7 minutes of terror\" pause for well-deserved \"7 minutes of triumph\"! #MSL http://t.co/6SYzYsIU', 'MarsCuriosity', '2012-08-08 19:58:28', 1344376800),
(1309, 233269565096869889, 'Coming Attraction: My hi-res descent video. This 1 frame preview features the heat shield dropping away http://t.co/zR9044hX', 'MarsCuriosity', '2012-08-08 18:32:52', 1344376800),
(1310, 233246243508338688, 'RT @NASAJPL: Watch Live: New @MarsCuriosity images from the Red Planet. @NASA news briefing, Aug. 8 10am PT (1700 UTC) http://t.co/i39BnAV0', 'MarsCuriosity', '2012-08-08 17:00:12', 1344376800),
(1311, 232894533623488512, 'â€œScene of the Crimeâ€ image of my landing site + scattered #MSL hardware. Sharing science? Guilty as charged. http://t.co/rtFGWaPa', 'MarsCuriosity', '2012-08-07 17:42:38', 1344290400),
(1312, 232883646095319040, 'Live Now: A closer look at my latest images from Mars. @NASAJPL news briefing, Aug. 7 10am PT (1700 UTC) http://t.co/IbvjOpYd', 'MarsCuriosity', '2012-08-07 16:59:22', 1344290400),
(1313, 232864397855432704, 'Good golly miss MAHLI! New color pic from Mars Hand Lens Imager shows tan sands, no @instagram req #MSL http://t.co/sPYYxAyW', 'MarsCuriosity', '2012-08-07 15:42:54', 1344290400),
(1314, 232624632757370882, 'Look out below! What descent to the surface of Mars looked like from my POV #MSL #MARDI [video] http://t.co/Sd6gl4zA', 'MarsCuriosity', '2012-08-06 23:50:09', 1344290400),
(1315, 232612664411570176, 'Drumroll, please... the latest news &amp; images from Mars via @NASAJPL, 4 pm PDT (2300 UTC) Watch live: http://t.co/0NsoaSC2', 'MarsCuriosity', '2012-08-06 23:02:35', 1344290400),
(1316, 232524619528167425, '@mediadeo No microphone. None was called for in the science payload. See what I *am* carrying here: http://t.co/tgdtOIwd #MSL', 'MarsCuriosity', '2012-08-06 17:12:44', 1344204000),
(1317, 232516298872090624, '@sesamestreet Science is cool. Yip-yip-yip-yip... Uh-huh. Uh-huh. #STEM #MSL', 'MarsCuriosity', '2012-08-06 16:39:40', 1344204000),
(1318, 232507195944738816, 'Get the latest from my team. @NASAJPL news conference with new images from Mars, 9-10 am PT (1600-1700 UTC): http://t.co/0NsoaSC2', 'MarsCuriosity', '2012-08-06 16:03:29', 1344204000),
(1319, 232360007964971009, 'Meanwhile, back on Earth, my post-landing news conference is starting @NASAJPL. Watch live http://t.co/0NsoaSC2 #MSL', 'MarsCuriosity', '2012-08-06 06:18:37', 1344204000),
(1320, 232351189826678785, 'You asked for pics from my trip. Here you go! My 1st look (of many to come) of my new home... MARS! #MSL http://t.co/894ouNJt', 'MarsCuriosity', '2012-08-06 05:43:35', 1344204000),
(1321, 232347953321349121, 'Heatshield separation. Next up: Radar must lock on ground #MSL', 'MarsCuriosity', '2012-08-06 05:30:43', 1344204000),
(1322, 232347600597164032, 'Parachute deployed! Velocity 900 mph. Altitude 7 miles. 4 minutes to Mars! #MSL', 'MarsCuriosity', '2012-08-06 05:29:19', 1344204000),
(1323, 232346732938280960, 'Guided entry is begun. Here I go! #MSL', 'MarsCuriosity', '2012-08-06 05:25:52', 1344204000),
(1324, 232344892192477184, 'I feel lighter &amp; faster already. Cruise balance masses ejected and Mars is pulling me in #MSL', 'MarsCuriosity', '2012-08-06 05:18:33', 1344204000),
(1325, 232343991969013760, 'Cruise stage separation complete. So long &amp; thanks for all the navigation. 17 minutes to Mars! #MSL', 'MarsCuriosity', '2012-08-06 05:14:59', 1344204000),
(1326, 232343190299082752, 'Way to go, Odyssey! The Mars orbiter is in position to relay my communications during landing in real-time back to Earth #MSL', 'MarsCuriosity', '2012-08-06 05:11:47', 1344204000),
(1327, 232339344906661889, 'EDL main poll at @NASAJPL mission control. Nominal is my favorite word #MSL', 'MarsCuriosity', '2012-08-06 04:56:31', 1344204000),
(1329, 232318842867707904, '2 hours to Mars, 16,300 miles away and closing fast. Velocity = 8,900 mph. Watch live: http://t.co/MJLj3uaH #MSL', 'MarsCuriosity', '2012-08-06 03:35:03', 1344117600),
(1330, 232246928145010688, '@helenasrox It may be longer than that. Check out this video for all the ways I might phone home (and when) http://t.co/IiqrN6LW', 'MarsCuriosity', '2012-08-05 22:49:17', 1344117600);
